package net.yozo.services.front.download.bean;import net.yozo.services.front.template.bean.Template;import java.io.Serializable;public class Download extends net.yozo.services.common.Download implements Serializable {	private static final long serialVersionUID = 1L;	private Template template;	public void clear() {		super.clear();		if(template!=null){			template.clear();		}	}	public Template getTemplate() {		return template;	}	public void setTemplate(Template template) {		this.template = template;	}}